import React from "react";
import { useSelector } from "react-redux";
import NavigationItem from "./nav-item.js";

const NavigationSidebar = () => {
  const nav = useSelector((state) => state.nav);
  console.log(nav);
  return (
    <div>
      <div className="list-group">
        {nav.map((item) => (
          <NavigationItem navItem={item} key={item.name} />
        ))}
      </div>
      <button type="submit" className="btn w-100 mt-3 btn-primary rounded-pill">
        Tuit
      </button>
    </div>
  );
};
export default NavigationSidebar;
